import "./UserList.css"
import { DataGrid } from '@material-ui/data-grid';


export default function UserList(){
    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        {
            field: "user",
            headerName: "User",
          width: 150,
          renderCell: (params) => {
            return (
              <div className="userListUser">
                <img className="userListImg" src={params.row.avatar} alt="" />
                {params.row.username}
              </div>
            );
          },
          editable: true,
        },
        {
          field: 'email',
          headerName: 'Email',
          width: 150,
          editable: true,
        },
       
          {
            field: 'CCRating',
            headerName: 'CodeChef Rating',
            type: 'number',
            width: 200,
            editable: true,
          },
          {
            field: 'CFRating',
            headerName: 'CodeForces Rating',
            type: 'number',
            width: 200,
            editable: true,
          },
          {
            field: 'Streak',
            headerName: 'Contest Streak',
            type: 'number',
            width: 200,
            editable: true,
          },
      ];
      
      const rows = [
        { id: 1, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 2, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 3, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 4, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 1, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 1, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},
        { id: 1, user: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",CCRating: 1800, CFRating: 1800, Streak: 33},

      ];


    return(
        <div className="userList">
       <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        checkboxSelection
        disableSelectionOnClick
      />
        </div>
    )
}
